          '[(A)14(dob)-3(e A)14(cr)8(oba)8(t Reader 9 ou v)15(ersion ult)5(\\351rieur)8(e)16(.)]';
      const String text3 =
          // ignore: use_raw_strings
          '[(T)77(\\351l\\351char)8(ger t)6(out de suit)6(e A)13(dobe R)-3(eader)]';
      final PdfDocument lDoc = PdfDocument.fromBase64String(wf26201);
      final PdfPage page = lDoc.pages[0];
      final PdfPageResources resource =
          PageResourceLoader().getPageResources(page);
      final FontStructure fontStructure =
          resource.resources['T1_0']! as FontStructure;
      final String str1 = fontStructure.decodeTextExtraction(text1, true);
      final String str2 = fontStructure.decodeTextExtraction(text2, true);
      final FontStructure fontStructure2 =
          resource.resources['T1_1']! as FontStructure;
      final String str3 = fontStructure2.decodeTextExtraction(text3, true);
      expect(str1,
          'Pour de meilleurs résultats, ouvrez ce porte-documents PDF dans 9,');
      expect(str2, 'Adobe Acrobat Reader 9 ou version ultérieure.');
      expect(str3, 'Télécharger tout de suite Adobe Reader');
      lDoc.dispose();
    });
